import React from 'react';
//import Game from './components/Game/index'
//import './App.css';
import logo from '../../assets/4inarow@2x.png'

function Home() {
  return (
    <div className="main_div">

    <div className="input-div">
    <div>


    <div className="playbtn">play</div><div ><img src={logo} className="img_div"></img></div>
    </div>
    <div className="btn_div">
        <button>Custom Game</button>
        <button>Two Players</button>
        <button>Game Online</button>
        <button>Training Game</button>
    </div>
    </div>

  </div>
  );
}

export default Home;
